export function getRandomNr(t,n){return Math.floor(Math.random()*(n-t)+t)}export function colorShade(t,n){3===(t=t.replace(/^#/,"")).length&&(t=t[0]+t[0]+t[1]+t[1]+t[2]+t[2]);let[a,r,e]=t.match(/.{2}/g);[a,r,e]=[parseInt(a,16)+n,parseInt(r,16)+n,parseInt(e,16)+n],a=Math.max(Math.min(255,a),0).toString(16),r=Math.max(Math.min(255,r),0).toString(16),e=Math.max(Math.min(255,e),0).toString(16);return`#${(a.length<2?"0":"")+a}${(r.length<2?"0":"")+r}${(e.length<2?"0":"")+e}`}